import React from "react";
import Logo from "../Assets/Logo/Logo-brainflix.png";
import Mohan from "../Assets/Images/Mohan.jpg";
// import Plus from "../Assets/Icons/PNG/Icon-upload.png";

import { Link } from "react-router-dom";

export default function Header() {
  return (
    <div className="header__container">
      <Link to="/">
        <img className="header__logo" alt="Headerpic" src={Logo} />
      </Link>
      <input
        className="header__searchbar"
        type="textbox"
        name="searchbar"
        placeholder="Search"
      ></input>
      <div className="header__upload">
        <Link to="/upload">
          <input
            className="header__button"
            type="button"
            name="upload"
            value="UPLOAD"
          ></input>
        </Link>
        <img className="header__mohan" alt="Mohan" src={Mohan} />
      </div>
    </div>
  );
}
